@GeneratorDelegateClass(componentType="AP", descriptionKey="GeneratorDelegateClass.LKM_Oracle_ERP_Cloud_to_File")
public class LKM_Oracle_ERP_Cloud_to_File_Direct extends OracleErpCloudExtractBaseKM {

  private Binding mBinding = null;

  public void setBinding(Binding binding) {
    super.setBinding(binding);
    mBinding = binding;

    try {
      //outputFile = getTargetSchemaName() + File.separator + getTargetResourceName();
      outputFile = srcSchema + File.separator + erpDS.getResourceName();
      mBinding.setVariable("outputFile", outputFile);

    } catch (Exception ex) {
      throw new RuntimeException(ex);
    }
  }

  // class constructor; initialization is done in setBinding method
  public LKM_Oracle_ERP_Cloud_to_File() {} 

  private MapPhysicalNode getTargetNode() {
    List<MapPhysicalNode> allNodes = physicalNode.getAllDownstreamNodes();
    if (allNodes == null || allNodes.isEmpty()) {
      throw new RuntimeException("No target node");
    }
    MapPhysicalNode targetNode;
    allNodes.each { if (it.isTargetNode()) targetNode = it; }
    return targetNode
  }

  private String getTargetSchemaName() {
    return getTargetNode().getExecutionUnit().getLocation().getPhysicalSchema().getSchemaName();
  }

  private String getTargetResourceName() {
    return ((OdiDataStore)getTargetNode().getLogicalComponent().getBoundObject()).getResourceName();
  }

  private ArrayList<Column> tgtColList(Table tgtTab) throws MappingException, AdapterException {
    ArrayList<Column> result = new ArrayList<Column>();

    for (MapPhysicalColumn col : physicalNode.getTAPTargetPhysicalColumns()) {
      result.add(Column.getColumn(tgtTab, col.getReferencedAttribute()));
    }

    return result;
  }

  private SqlQuery tgtSelectQuery(SqlQuery inputQuery) throws MappingException, GenerationException, AdapterException {
    ArrayList<ISelectItem> newSelectList = new ArrayList<ISelectItem>();
    ArrayList<StringExpression> newAliasList = new ArrayList<StringExpression>();

    for (MapPhysicalColumn col : physicalNode.getTAPTargetPhysicalColumns()) {
      MapExpression expr = col.getContextualAttributeReference().getReferencingContextualExpression().getExpression();
      newSelectList.add(new ArrayExpression(physicalNode, expr, inputQuery));
      newAliasList.add(new StringExpression(col.getName(),col));
    }

    SqlQuery result = inputQuery.clone();
    result.setSelectList(newSelectList);
    result.setAliasList(newAliasList);
    return result;
  }

  private void initTargetAST(FileInsertStatement insertStmt) throws MappingException, GenerationException, AdapterException {
    // Create properties that reflect the component KM option values for the physical target node
    List<IOptionValue> optValues = physicalNode.getOptionValues("TARGET");
    for (IOptionValue optValue : optValues) {
      insertStmt.setPropertyValue(optValue.getName(), optValue.getOptionValue());
    }
  }

  @ASTProducerMethod(processingType=ProcessingType.TARGET,producedASTType=FileInsertStatement.class, styleKey="ProcessingStyleKey.LKM_Oracle_ERP_Cloud_to_File.LOAD_TAP")
  public AbstractSyntaxTree LOAD_TAP(SqlQuery input) throws MappingException, AdapterException, GenerationException {
    ILocation tgtLoc = physicalNode.getLocation();
    if (tgtLoc == null) {
      throw new GenerationException("TAP node target location cannot be found.");
    }
    String jdbcMetadata = null;
    String tgtTableName = null;
    try {
      if (physicalNode.getExecutionUnit().isTAPUnit()) {
        // TAP as target case
        //tgtTableName = physicalNode.getExecutionUnit().getTAPTargetNodes().get(0).getSQLAccessName();
  	tgtTableName = getTargetSchemaName() + File.separator + getTargetResourceName();
        FileComponent fileComponent = (FileComponent) physicalNode.getLogicalComponent();
        jdbcMetadata = fileComponent.getMetadataForSnpsJDBCDrivers();
      }
    } catch (Exception e) {
      throw e;
    }

    Table tgtTable = new Table(tgtTableName);

    FileInsertStatement result = new FileInsertStatement(tgtTable, tgtColList(tgtTable), tgtSelectQuery(input));
    initTargetAST(result);
    result.setJDBCMetadata(jdbcMetadata);

    result.setTargetLocation(tgtLoc);
    result.setHasSourceAndTargetText(true);
    return result;
  }


} // End of LKM class
